import React from 'react';
import { useParams } from 'react-router-dom';
import {useIdea,IdeaProvider} from '../../context/idea.context';
export default <IdeaProvider><IdeaIndividual></IdeaIndividual></IdeaProvider>

const IdeaIndividual = () => {
  let {ideaID} = useParams();
  let {getIdea} = useIdea();
  getIdea(ideaID);

  return (
    <div className='container'>
      <h1>Parametro pasado: {ideaID}</h1>
    </div>
  )
}
